I have reproduced it by attempting to read the Java truststore file (PKCS12 with only certificates, no private key chains).

Code example:

```rust
let pkcs12 = Pkcs12::from_der(data)?;
let parsed = pkcs12.parse(password)?;
if let Some(chain) = parsed.chain {
    for cert in chain {
        println!("{:?}", cert.subject_name()); // <-- SEGFAULT
    }
}
```
The chain is returned as `Some` value and the X509 cert in there has a null internal pointer (checked it in the debugger).

